2 Days & 2 Nights
Who is this ideal for:
Summer Jo is ideal for couples, families 12+, divers, tourists and small groups seeking luxury, adventure, connection & reef exploration in comfort.
Departs Mondays and Wednesdays at 4 pm
Returns Wednesdays and Fridays at 2 pm
: Step aboard our newly refitted mega yacht, now more luxurious than ever, with top-notch amenities for ultimate comfort.
: Get ready for a social, action-packed journey filled with unforgettable moments of snorkelling and exploring the breathtaking Whitsundays.
Dive into Vibrant Coral Reefs
: Immerse yourself in flourishing fringing reefs as you snorkel or dive in some of the most spectacular underwater spots around.
: Visit the world-famous Whitehaven Beach and other postcard-worthy Whitsunday locations—each one more stunning than the last.
Level Up Your Dive Skills
: Take your adventure to the next level with the option to complete your Advanced Dive Course right on board!
Day 1 – 4 PM
: Set off from the Port of Airlie and cruise toward Tongue Bay. Get to know your fellow travellers while soaking in the stunning scenery and your first unforgettable Whitsunday sunset.
: Begin your day with a beautiful sunrise, a hot cup of coffee, and a delicious breakfast. Spend your final morning exploring your last snorkel and dive spots before we head back into port, ending your unforgettable Whitsundays journey.
Day 1: Culinary Journey Begins
Exquisite Fruit Platter with a vibrant array of seasonal fruits, artfully arranged to awaken your senses.
Authentic Chicken Tikka Masala; Tender chicken morsels simmered in a rich, aromatic sauce infused with exotic spices.
Fluffy Steamed Rice; A perfectly cooked companion, fluffy and fragrant, ideal for soaking up every delicious drop.
Mango Chickpea Salad; A refreshing medley of succulent mango and hearty chickpeas, dressed in a tangy vinaigrette for that bright zing.
Yogurt Mint Raitha; Creamy yogurt blended with fresh mint, a cooling delight to complement the spices.
Crispy Samosas and Onion Bhajis; Golden, flaky pastries filled with spiced goodness, served alongside savory onion fritters, all begging to be dipped.
Heavenly Berry and Apple (or Peach) Crumble; A luscious blend of fruits enveloped in a buttery, crumbly topping that melts in your mouth, served warm for the ultimate indulgence.
Day 2: A Wholesome Delight
Buffet featuring fresh bread selection, decadent spreads, crisp and crunchy cereals, creamy yogurts and more!
Morning Tea: Gourmet Mini Muffins; Delightfully moist and bursting with flavours, these bite-sized treats are perfect for a cozy morning.
Savory Wraps; Soft, warm wraps brimming with your choice of delicious fillings, perfectly wrapped to perfection.
Artisan Cold Meats or Flavourful Falafel; Succulent slices of fine meats or crispy falafel for a hearty bite.
Garden-Fresh Salad; A vibrant bowl of greens, kissed by the crunch of lettuce and a drizzle of dressing.
Sundried Tomato Pesto; Rich and flavourful, this pesto elevates every bite with its sun-kissed essence.
Creamy Hummus with Fresh Veggies; Silky smooth hummus paired with fresh celery, carrots, capsicum, and crisp rice crackers for dipping.
Rich Chilli Con Carne; Hearty and spicy, this robust dish is a perfect blend of tender meat and bold spices.
Creamy Guacamole; Indulge in rich, velvety guacamole, a must-have for dipping!
Fluffy Rice; The perfect base to soak up all those captivating flavours.
Crispy Tortilla Chips; Golden and crunchy, ideal for scooping and crun
=== TOUR END: Summer Jo 2D2N ===
